import './App.css';
import Home from './components/home';
import Login from './components/login';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

function App() {
  return (
    <>
    <Login></Login>
    <Router>

        {/* Routes for navigation */}
        <Routes>



          {/* Home route */}
          <Route path='/home' element={<Home />} />
        </Routes>

    </Router>
    </>
  );
}

export default App;
